pragma solidity ^0.4.24;

contract InvestmentScreen {

address owner;

uint memberNumber;

struct Member {
  address account;
  uint id;
  string firstName;
  string lastName;
  uint memberType;
}

enum memberType {
  Investor,
  Assessor,
  Investee
}

mapping (address => Member) public members;


constructor() public {
  owner = msg.sender;
  memberNumber = 0;
}

event MemberAdded(
  address _account,
  uint indexed _id,
  string _firstName,
  string _lastName,
  uint _memberType
  );

// Enroll new member accounts
function addMember(address _account, string _firstName, string _lastName, uint _memberType) public {
    /* emit MemberAdded(memberNumber); */
    _account = msg.sender;
    members[_account] = Member({account: _account, id: memberNumber, firstName: _firstName, lastName: _lastName, memberType: _memberType});
    memberNumber++;
    emit MemberAdded(_account, memberNumber, _firstName, _lastName, _memberType);
  }

// Get the number of members
function getNumberOfMembers() public view returns(uint){
  return memberNumber;
}

// View users
  function viewMember(address _member) view public returns(uint, string, string, uint) {
    Member storage member = members[_member];
    return(member.id, member.firstName, member.lastName, member.memberType);
  }

